script: |
  super -f text -I q13264.spq | sort > q13264.out

inputs:
  - name: q13264.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE + + col0 + col1 * + 14 NOT BETWEEN + col1 - - col1 AND + ( + + col1 ) * - - ( ( - col0 ) );
  - name: tab1

outputs:
  - name: q13264.out
    data: |
      51	14	96
      85	5	59
      91	47	68
